import React, { Component } from 'react'
import Modal  from 'react-modal'
import * as classNames from 'classnames/bind'
import axios from 'axios'
import styles from './Modals.scss'

const cx = classNames.bind(styles)

const img = ``;
 
const customStyles = {
    content : {
        top : '50%',
        left : '50%',
        right : 'auto',
        bottom : 'auto',
        marginRight : '-50%',
        transform: 'translate(-50%, -50%)',
        border: 'none',
        width: '100vw',
        height: '100vh',
        background: 'rgba(0, 0, 0, 0.25)',
        display: 'flex',
        justifyContent: 'center',
        alignItems: 'center'
    }
};

class Modals extends Component {
    constructor(props) {
        super(props);

        this.state = {
          isOpen: true,
          title: ''
        }

        this.onChange = this.onChange.bind(this)
        this.onClick = this.onClick.bind(this)
    }

    onClose = () => {
      this.setState({
        isOpen: false
      })
    }

    onChange = (e) => {
      this.setState({
        title: e.target.value
      })
    }

    onClick = () => {
      axios.post('/upload/image', {
        "title": this.state.title,
        "image": img,
        "id": "admin"
      })
      .then(res => {
        console.log(res)
        window.location.replace('/')
      })
    }

    render() {
      const { isOpen } = this.state;
      return (
          <Modal isOpen={isOpen} style={customStyles} ariaHideApp={false}>
            <div className={cx('Modal')} >
              <h1>이미지의 하수관은 <span>불량 하수관</span>으로 분석되었습니다.</h1>
              <div style={{backgroundImage: `url(data:image/jpeg;base64,${img})`}}/>
              <h2>하수관의 위치</h2>
              <input type="text" onChange={(e) => this.onChange(e)}/>
              <h2>카테고리</h2>
              <div>
              <select>
                <option value="02">관천공</option>
                <option value="03">관파손</option>
                <option value="04">균열</option>
                <option value="05">연결관돌출</option>
                <option value="06">연결관접합</option>
                <option value="07">이음부결함</option>
                <option value="08">토사퇴적</option>
              </select>
              <select>
                <option value="02">관천공</option>
                <option value="03">관파손</option>
                <option value="04">균열</option>
                <option value="05">연결관돌출</option>
                <option value="06">연결관접합</option>
                <option value="07">이음부결함</option>
                <option value="08">토사퇴적</option>
              </select>
              </div>
              <button onClick={() => this.onClick()}>목록에 추가하기</button>
            </div>
          </Modal>
        )
    }
}

export default Modals